import Navbar from "../components/Navbar";

const Index = () => {
  return (
    <section>
      <Navbar />
      <h1>Here comes JSX !</h1>
      <style jsx global>
        {`
          a {
            padding: 10px;
            text-decoration: none;
            color: green;
          }
        `}
      </style>
    </section>
  );
};

export default Index;
